import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Profile = () => {
    const [properties, setProperties] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchProperties = async () => {
            const token = localStorage.getItem('token');
            try {
                const response = await fetch('http://localhost:5000/properties/user', {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });

                if (response.ok) {
                    const data = await response.json();
                    setProperties(data);
                } else {
                    console.error('Error fetching properties');
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        fetchProperties();
    }, []);

    const handleDelete = async (id) => {
        const token = localStorage.getItem('token');
        try {
            const response = await fetch(`http://localhost:5000/properties/${id}`, {
                method: 'DELETE',
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });

            if (response.ok) {
                setProperties(properties.filter((property) => property.id !== id));
            } else {
                console.error('Error deleting property');
            }
        } catch (error) {
            console.error('Error:', error);
        }
    };

    const handleEdit = (id) => {
        navigate(`/edit-property/${id}`);
    };

    return (
        <div>
            <h1>My Properties</h1>
            {properties.map((property) => (
                <div key={property.id}>
                    <h2>{property.title}</h2>
                    <p>{property.description}</p>
                    <p>{property.location}</p>
                    <p>{property.price}</p>
                    {property.image && <img src={`http://localhost:5000/uploads/${property.image}`} alt={property.title} />}
                    <button onClick={() => handleEdit(property.id)}>Edit</button>
                    <button onClick={() => handleDelete(property.id)}>Delete</button>
                </div>
            ))}
        </div>
    );
};

export default Profile;
